import chess

def index_to_uci_move(move_index):
    from_square = move_index // 64
    to_square = move_index % 64
    move = chess.Move(from_square, to_square)
    return move.uci()

def evaluate_central_control(uci_moves, max_moves=10):
    """
    Evaluate central control in the first `max_moves` moves to determine
    which player played more human-like (based on central occupation).

    :param uci_moves: List of UCI moves
    :param max_moves: Number of moves to evaluate (default: 10)
    :return: Dictionary containing White and Black's central control scores
             and the more human-like player.
    """
    # Define central and extended central squares
    central_squares = {chess.E4, chess.D4, chess.E5, chess.D5}  # Core central squares
    extended_central_squares = {chess.C3, chess.C4, chess.F3, chess.F4,
                                chess.C5, chess.F5, chess.D6, chess.E6}  # Extended center
    all_central_squares = central_squares | extended_central_squares

    board = chess.Board()  # Initialize chess board
    white_score, black_score = 0, 0  # Initialize scores

    # Evaluate only the first `max_moves`
    for i, move in enumerate(uci_moves[:max_moves]):
        move_obj = chess.Move.from_uci(move)  # Convert UCI move to chess.Move object
        if move_obj.to_square in all_central_squares:  # Check if the move occupies the center
            if board.turn == chess.WHITE:
                white_score += 1  # White controls the center
            else:
                black_score += 1  # Black controls the center

        board.push(move_obj)  # Update the board state

    # Determine the more human-like player based on central control
    if white_score > black_score:
        more_human = "White"
    elif black_score > white_score:
        more_human = "Black"
    else:
        more_human = "Both are equal"

    return {
        "White Central Control": white_score,
        "Black Central Control": black_score,
        "More Human-like": more_human
    }

def process_action_sequences(action_sequences, max_moves=10):
    """
    Process a list of action sequences, convert them to UCI moves,
    and evaluate central control for each sequence.

    :param action_sequences: List of lists containing numerical actions
    :param max_moves: Number of moves to evaluate per game
    :return: List of evaluation results for each sequence
    """
    results = []
    for actions in action_sequences:
        # Convert actions to UCI move sequence
        results_ = []
        for i in actions :
            uci_moves = index_to_uci_move(i)
            results_.append(uci_moves)

            # Evaluate central control
        evaluation_ = evaluate_central_control(results_, max_moves)
        results.append(evaluation_)

    return results

